  false,\n\t\"url\": null,\n\t\"notes\": \"The project as described was to attempt
  to eradicate yellow-flag iris from Toppenish, McNary and Columbia National Wildlife
  Refuges using chemical and, where necessary, manual methods.  Yellow-flag iris is
  an escaped ornamental rhizomatous perennial herb that can form dense mats in riparian
  and wetland areas, displacing native vegetation while providing little habitat or
  forage value for wildlife.  Iris had relatively recently invaded these three refuges
  and was showing up in numerous distinct yet disparate areas, infesting what had
  been estimated as 12 acres within nearly 4,000 acres of moist soil units, wetlands
  and impoundments.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
